import React from "react";

class Navb extends React.Component {

    constructor() {
        super();
    }
    render() {
        return ( <
            React.Fragment >
            <
            div className = 'navbar' >
            <
            nav className = 'navbar navbar-dark bg-dark navbar-expend-sm' >
            <
            a href = '/'
            className = 'navbar-brand' > React Navbar < /a> < /
            nav > < /
            div > < /
            React.Fragment >
        )
    };

}
export default Navb;
